def test_image(path_img = None):

  model = torch.load("/content/drive/MyDrive/Università/Progetto Lab IAGI/model.pt", map_location=torch.device(device))
  model.eval()

  img = mpimg.imread(path_img)
  imgplot = plt.imshow(img)
  plt.grid(False)
  plt.show()

  transform = transforms.Compose([transforms.ToPILImage(),
                                transforms.Resize(resolution),
                                transforms.ToTensor(),
                                transforms.Normalize(mean=[0.485, 0.456, 0.406], std=[0.229, 0.224, 0.225])])
  

  img = transform(img)
  npimg = img.numpy()
  img_size = transforms.functional.get_image_size(img)
  img = reshape(img, [1,3,img_size[0], img_size[1]])

  img = img.to(device)

  outputs = model(img)
  outputs = torch.sigmoid(outputs)
  
  print("\n  Prediction: {:.3f}".format(outputs[0].item()))

  if(outputs[0].item()<=0.5):
    print("  --> Benign")
  else:
    print("  --> Malignant")

test_image(path_img = "/content/drive/MyDrive/Università/Progetto Lab IAGI/User Images/img1.jpg")

